import "./Navbar.css";
import NavHome from "./NavHome";
import NavImage from "./NavImage";
import NavItem from "./NavItem";
const Navbar = () => {
  return (
    <div className="navbar-container">
        <NavHome/>
        <NavItem content ='About'/>
        <NavImage/>
    </div>
  );
};

export default Navbar;
